    private var mValueExplorer : NSButton?
    private var mExplorerWindow : NSWindow?
  #endif

  //····················································································································

  #if BUILD_OBJECT_EXPLORER
    final func addExplorer (name : String, y : inout CGFloat, view : NSView) {
      let font = NSFont.boldSystemFont (ofSize: NSFont.smallSystemFontSize)
      let tf = NSTextField (frame:secondColumn (y))
      tf.isEnabled = true
      tf.isEditable = false
      tf.stringValue = name
      tf.font = font
      view.addSubview (tf)
      let valueExplorer = NSButton (frame:thirdColumn (y))
      valueExplorer.font = font
      valueExplorer.title = self.explorerIndexString + " " + String (describing: type (of: self))
      valueExplorer.target = self
      valueExplorer.action = #selector(SelectionController_AutoLayoutMergerDocument_mBoardModelSelection.showObjectWindowFromExplorerButton(_:))
      view.addSubview (valueExplorer)
      mValueExplorer = valueExplorer
      y += EXPLORER_ROW_HEIGHT
    }
  #endif

  //····················································································································

  #if BUILD_OBJECT_EXPLORER
    func buildExplorerWindow () {
    //-------------------------------------------------- Create Window
      let r = NSRect (x:20.0, y:20.0, width:10.0, height:10.0)
      mExplorerWindow = NSWindow (contentRect: r, styleMask: [.titled, .closable], backing: .buffered, defer: true, screen: nil)
    //-------------------------------------------------- Adding properties
      let view = NSView (frame:r)
      var y : CGFloat = 0.0
      createEntryForPropertyNamed (
        "artworkName",
        object: self.artworkName_property,
        y: &y,
        view: view,
        observerExplorer: &self.artworkName_property.mObserverExplorer,
        valueExplorer: &self.artworkName_property.mValueExplorer
      )
      createEntryForPropertyNamed (
        "layerConfiguration",
        object: self.layerConfiguration_property,
        y: &y,
        view: view,
        observerExplorer: &self.layerConfiguration_property.mObserverExplorer,
        valueExplorer: &self.layerConfiguration_property.mValueExplorer
      )
      createEntryForPropertyNamed (
        "modelHeight",
        object: self.modelHeight_property,
        y: &y,
        view: view,
        observerExplorer: &self.modelHeight_property.mObserverExplorer,
        valueExplorer: &self.modelHeight_property.mValueExplorer
      )
      createEntryForPropertyNamed (
        "modelHeightUnit",
        object: self.modelHeightUnit_property,
        y: &y,
        view: view,
        observerExplorer: &self.modelHeightUnit_property.mObserverExplorer,
        valueExplorer: &self.modelHeightUnit_property.mValueExplorer
      )
      createEntryForPropertyNamed (
        "modelLimitWidth",
        object: self.modelLimitWidth_property,
        y: &y,
        view: view,
        observerExplorer: &self.modelLimitWidth_property.mObserverExplorer,
        valueExplorer: &self.modelLimitWidth_property.mValueExplorer
      )
      createEntryForPropertyNamed (
        "modelLimitWidthUnit",
        object: self.modelLimitWidthUnit_property,
        y: &y,
        view: view,
        observerExplorer: &self.modelLimitWidthUnit_property.mObserverExplorer,
        valueExplorer: &self.modelLimitWidthUnit_property.mValueExplorer
      )
      createEntryForPropertyNamed (
        "modelWidth",
        object: self.modelWidth_property,
        y: &y,
        view: view,
        observerExplorer: &self.modelWidth_property.mObserverExplorer,
        valueExplorer: &self.modelWidth_property.mValueExplorer
      )
      createEntryForPropertyNamed (
        "modelWidthUnit",
        object: self.modelWidthUnit_property,
        y: &y,
        view: view,
        observerExplorer: &self.modelWidthUnit_property.mObserverExplorer,
        valueExplorer: &self.modelWidthUnit_property.mValueExplorer
      )
      createEntryForPropertyNamed (
        "name",
        object: self.name_property,
        y: &y,
        view: view,
        observerExplorer: &self.name_property.mObserverExplorer,
        valueExplorer: &self.name_property.mValueExplorer
      )
      createEntryForPropertyNamed (
        "zoom",
        object: self.zoom_property,
        y: &y,
        view: view,
        observerExplorer: &self.zoom_property.mObserverExplorer,
        valueExplorer: &self.zoom_property.mValueExplorer
      )
    //-------------------------------------------------- Finish Window construction
    //--- Resize View
      let viewFrame = NSRect (x:0.0, y:0.0, width:EXPLORER_ROW_WIDTH, height:y)
      view.frame = viewFrame
    //--- Set content size
      mExplorerWindow?.setContentSize (NSSize (width:EXPLORER_ROW_WIDTH + 16.0, height:fmin (600.0, y)))
    //--- Set close button as 'remove window' button
      let closeButton : NSButton? = mExplorerWindow?.standardWindowButton (.closeButton)
      closeButton?.target = self
      closeButton?.action = #selector(SelectionController_AutoLayoutMergerDocument_mBoardModelSelection.deleteSelectionControllerWindowAction(_:))
    //--- Set window title
      let windowTitle = self.explorerIndexString + " " + String (describing: type (of: self))
      mExplorerWindow!.title = windowTitle
    //--- Add Scroll view
      let frame = NSRect (x:0.0, y:0.0, width:EXPLORER_ROW_WIDTH, height:y)
      let sw = NSScrollView (frame:frame)
      sw.hasVerticalScroller = true
      sw.documentView = view
      mExplorerWindow!.contentView = sw
    }
  #endif
